oxy_webhelp_navlinks = {"evaluate_sla_options_gcp-d23139e14086":{"topics":[{"title":"Source snapshot retention for GCP workloads","shortdesc":"<p class=\"shortdesc\">Source snapshot retention for GCP workloads ensures data protection and         recoverability by allowing you to set various retention policies. These policies include         retaining hourly, daily, weekly, monthly, quarterly, and yearly snapshots to meet         compliance, business continuity, and disaster recovery requirements.<\/p>","href":"gcp\/source_snapshot_retention_gcp.html","attributes":{"data-id":"source_snapshot_retention_gcp"},"menu":{"hasChildren":false},"tocID":"source_snapshot_retention_gcp-d23139e14097","topics":[]},{"title":"Retention lock for GCP workloads","shortdesc":"<p class=\"shortdesc\">A retention lock on an SLA Domain is a security feature that prevents premature         deletion of snapshots of GCP workloads.<\/p>","href":"gcp\/retention_lock_gcp.html","attributes":{"data-id":"retention_lock_gcp"},"menu":{"hasChildren":false},"tocID":"retention_lock_gcp-d23139e14108","topics":[]},{"title":"Archiving for GCP workloads","shortdesc":"<p class=\"shortdesc\">Archiving in <span class=\"ph\">RSC<\/span> tiers GCE instance or persistent disk snapshots to         lower-cost GCS storage classes, ensuring cost savings, compliance, and security.<\/p>","href":"gcp\/archiving_gcp.html","attributes":{"data-id":"archiving_gcp"},"menu":{"hasChildren":false},"tocID":"archiving_gcp-d23139e14119","topics":[]},{"title":"Multiple archival locations for GCP","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> supports multiple archival locations for GCE instances or         persistent disks, allowing granular control over data archiving with up to two distinct         archiving policies.<\/p>","href":"gcp\/multiple_arch_loc_gcp.html","attributes":{"data-id":"multiple_arch_loc_gcp"},"menu":{"hasChildren":false},"tocID":"multiple_arch_loc_gcp-d23139e14133","topics":[]}]}};